/**
  ******************************************************************************
  * @file    model.cc
  * @author  Pierre-Emmanuel Novac <penovac@unice.fr>, LEAT, CNRS, Université Côte d'Azur, France
  * @version 1.0.0
  * @date    24 march 2020
  * @brief   Template generating plain C code for the implementation of Convolutional Neural Networks on MCU
  */

#ifndef SINGLE_FILE
#include "number.h"
#include "model.h"

 // InputLayer is excluded
#include "conv1d_4.c"
#include "weights/conv1d_4.c" // InputLayer is excluded
#include "max_pooling1d_2.c" // InputLayer is excluded
#include "conv1d_5.c"
#include "weights/conv1d_5.c" // InputLayer is excluded
#include "max_pooling1d_3.c" // InputLayer is excluded
#include "flatten_3.c" // InputLayer is excluded
#include "dense_3.c"
#include "weights/dense_3.c"
#endif

void cnn(
  const number_t input[MODEL_INPUT_CHANNELS][MODEL_INPUT_SAMPLES],
  dense_3_output_type dense_3_output) {

  // Output array allocation
  static union {
    conv1d_4_output_type conv1d_4_output;
    conv1d_5_output_type conv1d_5_output;
  } activations1;

  static union {
    max_pooling1d_2_output_type max_pooling1d_2_output;
    max_pooling1d_3_output_type max_pooling1d_3_output;
    flatten_3_output_type flatten_3_output;
  } activations2;


  //static union {
//
//    static input_6_output_type input_6_output;
//
//    static conv1d_4_output_type conv1d_4_output;
//
//    static max_pooling1d_2_output_type max_pooling1d_2_output;
//
//    static conv1d_5_output_type conv1d_5_output;
//
//    static max_pooling1d_3_output_type max_pooling1d_3_output;
//
//    static flatten_3_output_type flatten_3_output;
//
  //} activations;

  // Model layers call chain
 // InputLayer is excluded 
  conv1d_4(
     // First layer uses input passed as model parameter
    input,
    conv1d_4_kernel,
    conv1d_4_bias,
    activations1.conv1d_4_output
  );
 // InputLayer is excluded 
  max_pooling1d_2(
    
    activations1.conv1d_4_output,
    activations2.max_pooling1d_2_output
  );
 // InputLayer is excluded 
  conv1d_5(
    
    activations2.max_pooling1d_2_output,
    conv1d_5_kernel,
    conv1d_5_bias,
    activations1.conv1d_5_output
  );
 // InputLayer is excluded 
  max_pooling1d_3(
    
    activations1.conv1d_5_output,
    activations2.max_pooling1d_3_output
  );
 // InputLayer is excluded 
  flatten_3(
    
    activations2.max_pooling1d_3_output,
    activations2.flatten_3_output
  );
 // InputLayer is excluded 
  dense_3(
    
    activations2.flatten_3_output,
    dense_3_kernel,
    dense_3_bias, // Last layer uses output passed as model parameter
    dense_3_output
  );

}
